const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <Info mdxType="Info">
Uniswap V1, while still fully functional, is no longer under active development. Looking for <Link to='/docs/v2/' mdxType="Link">V2 documentation</Link>?
    </Info>
    <p>{`It is possible that a token you are interested in is not included in the token dropdown on `}<a parentName="p" {...{
        "href": "https://app.uniswap.org/#/swap?use=v1"
      }}>{`https://app.uniswap.org/#/swap?use=v1`}</a>{`, however, all tokens that have a deployed uniswap exchange are supported on the front-end.`}</p>
    <p>{`There are three ways to interact with tokens that are not yet included on the default list.`}</p>
    <h2 {...{
      "id": "1-paste-the-token-address-into-the-search-box"
    }}>{`1. Paste the token address into the search box.`}</h2>
    <p>{`If a token is not included in the list, try pasting the token address into the search box. It will populate the dropdown with the token you are looking for.`}</p>
    <h2 {...{
      "id": "2-custom-linking"
    }}>{`2. Custom Linking`}</h2>
    <p><a parentName="p" {...{
        "href": "https://app.uniswap.org/#/swap?use=v1"
      }}>{`https://app.uniswap.org/#/swap?use=v1`}</a>{` supports custom linking to all tokens that have a Uniswap exchange. See `}<Link to='/docs/v1/frontend-integration/custom-linking' mdxType="Link">{`Custom Linking`}</Link>{` for details on how to link.`}</p>
    <p>{`For example, to populate the output token field with an unlisted token, we can specify the outputCurrency in the URL and pass in the token's address like this:`}</p>
    <p><inlineCode parentName="p">{`https://app.uniswap.org/#/swap?use=v1?outputCurrency=0xfA3E941D1F6B7b10eD84A0C211bfA8aeE907965e`}</inlineCode></p>
    <h2 {...{
      "id": "3-make-a-request-to-get-your-token-listed"
    }}>{`3. Make a request to get your token listed`}</h2>
    <p>{`For tokens that have high market caps, high liquidity provision, or high trading volume, you can fill out a `}<a parentName="p" {...{
        "href": "https://docs.google.com/forms/d/e/1FAIpQLSdQMI4KnQ1lCB0aiwzQ8xGTL59EX5FtkF6f2nT-JeQcxpW2Sw/formResponse"
      }}>{`request to be added to the dropdown menu`}</a></p>
    <h2 {...{
      "id": "token-details-and-assets"
    }}>{`Token Details and Assets`}</h2>
    <p>{`Token information (including decimals, symbol, name, etc.) is pulled from token contracts directly. Logo images are pulled from TrustWallet. If you'd like your token logo updated make a pull request into the TrustWallet assets repo `}<a parentName="p" {...{
        "href": "https://github.com/trustwallet/assets"
      }}>{`https://github.com/trustwallet/assets`}</a>{`.`}</p>
    </MDXLayout>;
}

